class BidService{
    addBidService=(data)=>{
        console.log("service: ",data)
        return fetch("https://dealsbazzar.herokuapp.com/bid/addBid", {
            method: "POST",
            headers: {
                "Content-Type": "application/json"
            },
            body: JSON.stringify(data)
        })
    }
}

var obj = new BidService()
export default obj;
